  const handleSearchItem = (item) => {
    setSearchItem(item)
  }

  const filterJobs = jobs.filter((job) => 
    job.title.toLowerCase().includes(searchItem.toLowerCase())
  )


  return (
      <>
        <Header onSearchChange={handleSearchItem}></Header>
       
